function App() {
  return (
    <div>
      {isShown && <ExpenseSelector />}
      <div className="checkout-wrapper">
        <TotalCount /> 
        <CustomButton 
          border="none"
          bgColor="#F0A023"
          color="#FFFFFF"
          fontSize="16px"
          fontWeight="500"
          height = "38px"
          onClick={handleClick}
          radius = "19px"
          width = "125px"
          children = "Add receipt"
        />
      </div>
    </div>
  );
}

export default App;
